import { Col } from "react-bootstrap";

const OurWork = () => {
    return (
        <div className="ourName">
            <h3>We've made puzzles for movies, musicians and companies</h3>
            <div>
                <Col></Col>
            </div>
        </div>
    );
}

export default OurWork;
